# FGSM adversarial attack
class FGSM():
    def __init__(self, model):
        self.model = model
        self.backup = {}
        self.grad_backup = {}

    def attack(self, emb_name_lst):
        for name, param in self.model.named_parameters():
            for emb_name in emb_name_lst:
                if param.requires_grad and emb_name in name:
                    self.backup[name] = param.data.clone()
                    delta = nn.functional.normalize(param.grad, p=2, dim=0, eps=0.5)
                    param.data.add_(delta)
    
    def attack_w1(self, emb_name_lst):
        for name, param in self.model.named_parameters():
            for emb_name in emb_name_lst:
                if param.requires_grad and emb_name in name:
                    self.backup[name] = param.data.clone()
                    if "dense" in name:
                        weight = 0.4
                    if "one_hot" in name or "multi_hot" in name:
                        weight = 0.4
                    if "text" in name:
                        weight = 0.2
                    delta = nn.functional.normalize(param.grad, p=2, dim=0, eps=0.5)
                    param.data.add_(delta*weight)

    def attack_auto_weight(self, weight_dict, emb_name_lst):
        for name, param in self.model.named_parameters():
            for emb_name in emb_name_lst:
                if param.requires_grad and emb_name in name:
                    self.backup[name] = param.data.clone()
                    if "dense" in name:
                        weight = weight_dict["dense"]
                    if "one_hot" in name or "multi_hot" in name:
                        weight = weight_dict["sparse"]
                    if "text" in name:
                        weight = weight_dict["text"]
                    delta = nn.functional.normalize(param.grad, p=2, dim=0, eps=0.5)
                    param.data.add_(delta*weight)

    def weighted_attack(self, emb_name_lst, epoch_num):
        grad_dic = {}
        weight_dic = {}
        for name, param in self.model.named_parameters():
            for emb_name in emb_name_lst:
                if param.requires_grad and emb_name in name:
                    self.backup[name] = param.data.clone()
                    tmp_grad = param.grad.view(-1, 1)
                    tmp_grad_mean = torch.mean(tmp_grad, dim=0, keepdim=False)
                    grad_dic[name] = tmp_grad_mean
        sort_lst = sorted(grad_dic.items(), key = lambda item:item[1])
        weight = 2
        for tuple_i in sort_lst:
            weight_dic[tuple_i[0]] = weight
            weight = weight - 0.2
            if weight < 0:
                weight  = 0.01
        if int(epoch_num) % 600 ==0:
            print("*"*20)
            print(sort_lst)
            print(weight_dic)
            print("*"*20)
        for name, param in self.model.named_parameters():
            for tuple_i in sort_lst:
                if param.requires_grad and tuple_i[0] in name:
                    delta = nn.functional.normalize(param.grad, p=2, dim=0, eps=0.5)
                    param.data.add_(weight_dic[tuple_i[0]]*delta)

    def restore(self, emb_name_lst):
        for name, param in self.model.named_parameters():
            for emb_name in emb_name_lst:
                if param.requires_grad and emb_name in name:
                    assert name in self.backup
                    param.data = self.backup[name]
        self.backup = {}
    
    def backup_grad(self, emb_name_lst):
        for name, param in self.model.named_parameters():
            for emb_name in emb_name_lst:
                if param.requires_grad and emb_name in name: 
                    self.grad_backup[name] = param.grad.clone()
 
    def restore_grad(self, emb_name_lst):
        for name, param in self.model.named_parameters():
            for emb_name in emb_name_lst:
                if param.requires_grad and emb_name in name: 
                    param.grad = self.grad_backup[name]

# K-PGD adversarial attack
class PGD():
    def __init__(self, model):
        self.model = model
        self.emb_backup = {}
        self.grad_backup = {}
 
    def attack(self, emb_name_lst, epsilon=0.5, alpha=0.3, is_first_attack=False):
        for name, param in self.model.named_parameters():
            for emb_name in emb_name_lst:
                if param.requires_grad and emb_name in name:
                    if is_first_attack:
                        self.emb_backup[name] = param.data.clone()
                    delta = nn.functional.normalize(param.grad, p=2, dim=0, eps=0.5)
                    param.data.add_(delta)
                    param.data = self.project(name, param.data, 0.05)
 
    def restore(self, emb_name_lst):
        for name, param in self.model.named_parameters():
            for emb_name in emb_name_lst:
                if param.requires_grad and emb_name in name: 
                    assert name in self.emb_backup
                    param.data = self.emb_backup[name]
        self.emb_backup = {}
 
    def project(self, param_name, param_data, epsilon):
        r = param_data - self.emb_backup[param_name]
        if torch.mean(nn.functional.normalize(r)) > epsilon:
            r = epsilon * r / nn.functional.normalize(r)
            return self.emb_backup[param_name] + r
        else:
            return param_data
 
    def backup_grad(self, emb_name_lst):
        for name, param in self.model.named_parameters():
            for emb_name in emb_name_lst:
                if param.requires_grad and emb_name in name: 
                    self.grad_backup[name] = param.grad.clone()
 
    def restore_grad(self, emb_name_lst):
        for name, param in self.model.named_parameters():
            for emb_name in emb_name_lst:
                if param.requires_grad and emb_name in name: 
                    param.grad = self.grad_backup[name]


def get_sbert_embedding(sentence):
    model = SentenceTransformer('paraphrase-MiniLM-L6-v2')
    sentence_embedding = model.encode(sentence)
    sentence_embedding = torch.from_numpy(sentence_embedding)
    return sentence_embedding


def get_item_pic_embedding(item_id):
    dir = os.path.join('/data2/yiming/data')
    data_dir = os.path.join(dir, "pinterest/resnet_dic.pickle")
    f = open(data_dir, 'rb')
    data = pickle.load(f)
    out = list(itemgetter(*item_id)(data))
    pic_embeds = None
    for i in out:
        if pic_embeds == None:
            pic_embeds = i.unsqueeze(0)
        else:
            pic_embeds = torch.cat((pic_embeds, i.unsqueeze(0)), 0)
    return pic_embeds

