def get_multi_hot_embedding(multi_hot_embedsize, train_data, multi_hot):
    # tmp
    # multi_hot_embedsize = [16, 2197, 2539, 8, 6, 10, 7]
    sparse_emb_multi = nn.ModuleList([nn.Embedding(voc_size, 1) for voc_size in multi_hot_embedsize])
    for i, emb in enumerate(sparse_emb_multi):
        for idx, row in train_data[multi_hot].iterrows():
            tmp = str_to_lst(row[multi_hot[i]])
            input = torch.LongTensor(list(map(int, tmp)))
            embed_tmp = emb(input)
            embed_tmp = torch.mean(embed_tmp, 0, True).detach()
            if idx == 0:
                multi_hot_embed = embed_tmp
            else:
                multi_hot_embed = torch.cat((multi_hot_embed, embed_tmp), 0)
        if i == 0:
            multi_hot_embeds = multi_hot_embed.unsqueeze(1)
        else:
            multi_hot_embeds = torch.cat((multi_hot_embeds, multi_hot_embed.unsqueeze(1)), 1)
    return multi_hot_embeds

def get_multi_hot(multi_hot_embedsize, train_data, multi_hot):
    size_dict = dict(zip(multi_hot, multi_hot_embedsize))
    for i in range(len(multi_hot)):
        for idx, row in train_data[multi_hot].iterrows():
            tmp = str_to_lst(row[multi_hot[i]])
            tmp = torch.LongTensor(list(map(int, tmp)))
            zero_vec = np.zeros(size_dict[multi_hot[i]])
            for j in tmp:
                zero_vec[j] = 1
            if idx == 0:
                multi_hot_vec = torch.from_numpy(zero_vec).unsqueeze(0)
            else:
                multi_hot_vec = torch.cat((multi_hot_vec, torch.from_numpy(zero_vec).unsqueeze(0)), 0)
        if i == 0:
            multi_hot_vecs = multi_hot_vec
        else:
            multi_hot_vecs = torch.cat((multi_hot_vecs, multi_hot_vec), 1)
    return multi_hot_vecs


def str_to_lst(str_obj):
    str_obj = str_obj.replace("[", "")
    str_obj = str_obj.replace("]", "")
    lst_obj = str_obj.split(", ")
    return lst_obj

